create proc Proc_Controle_Versao
   @nomeArquivo varchar(64),
   @dtUltimaMod Datetime,
   @dtFechamento  varchar(8)  
As
   Insert into dbo.ControleVersao (
      nomeArquivo,
      dtIngestao,
      dtUltimaMod,
      dtFechamento
   )
   Values
   (
      @nomeArquivo,
      getdate(),
      @dtUltimaMod,
      @dtFechamento
   );
